import React from 'react';

import NavBackground from '../img/site-nav-background.png';

const SiteNavbar = () => {
	return (
		<div className="site-navbar">
			<img
				src={NavBackground}
				alt="nav background"
				style={{ width: '100%' }}
				className="nav-background"
			/>
			<div className="home">Home</div>
		</div>
	);
};

export default SiteNavbar;
